import './notFound.css'

function notFound (){
    return(
        
        <div className="notFound">

              <h1>LA PAGINA QUE ESTAS BUSCANDO NO EXISTE</h1>
              <img src="https://www.initcoms.com/wp-content/uploads/2020/07/404-error-not-found-1.png" alt="" />

        </div>
            
       
        
    );
}

export default notFound;
